import React,{Component} from 'react';
import Header from './Header';
import Description from './Description';
import Cycle from './Cycle';
import Nav from './Nav';
import Silkworm from './silkworm';
import { Container, Row, Col } from 'react-grid-system';
class Main extends Component{
    constructor(props){
      super(props);
      this.state={
        silk : Silkworm
      };
    }
  render(){
      return (
    <div style={{padding:"20px"}}>
      <Row style={{color:"white",background:"black",justifyContent:"center",padding:"20px",fontStyle:"italic"}}>
        <Header />               
      </Row>
      <Row>
          <Col sm={8} style={{background:"orangered",height:"690px",fontSize:"300%"}}>
              <Cycle />

          </Col>
          <Col sm={4} style={{background:"blue",fontSize:"300%"}}>
              <Description />
          </Col>
      </Row> 
      <Row>
          <Col md={8} style={{background:"aqua",padding:"15px"}}>
             <Nav />
          </Col>   
          <Col md={4} style={{background:"blue"}}>
          </Col>             
      </Row>   
    </div>
  );
      }
}

export default Main;
